import Link from 'next/link';
import { css, jsx } from "@emotion/core";
import styled from "@emotion/styled"

const Container = styled.div`
  display: block;
  
  position: fixed;
  padding: 15px 10px;
  margin: 0px;
  top: 0px;
  left: 0px;
  right: 0px;

  background-color: gray;
  border: solid;

  a{
    margin-left: 10px;
    margin-right: 10px;
  }
`;//margin: 15px;

const MemberWrapper = styled.div`
  display: inline;
  float: right;
  //justify-content: flex-end;
  
  border: solid;
  margin: 10px;
`;//float: right;


const Menu = styled.span`
  display: inline;
  float: left;
  
  margin: 10px;
`;//float: left;  justify-content: flex-start;

const Rank = styled.span`
  display: inline;
  float: right;
 

  margin: 10px;
`;//float: right;justify-content: flex-end; flex-direction: row-reverse;


const Header = () => (
  <Container>
    <MemberWrapper>
      <Link href="/">
      <a className='membership'>로그인</a>
      </Link>
      <Link href="/">
        <a className='membership'>회원가입</a>
      </Link>
    </MemberWrapper>



    <Menu>
      <Link href="/">
        <a className='menu' id='logo'>로고 OR 웹사이트명</a>
      </Link>
  
      <Link href="/">
        <a className='menu'>사이트 소개</a>
      </Link>
      <Link href="/">
        <a className='menu'>나의 사이트</a>
      </Link>
    </Menu>


    <Rank>  
        <a className='rank'>1. 더블슬래시</a>
        <a className='rank' id='button'>ㅁ</a>
    </Rank>
  </Container>
);

export default Header;
